// ==UserScript==
// @name         Handelscript
// @namespace    http://tampermonkey.net/
// @version      2024-10-27
// @description  try to take over the world!
// @author       Vonk
// @match        https://*.grepolis.com/game/*
// @icon         data:image/gif;base64,R0lGODlhAQABAAAAACH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==
// ==/UserScript==

(function () {
    'use strict';
    let tradeAlerts = {};
    let audio = new Audio("data:audio/mpeg;base64,");
    let observer;
    let firstTime = true;

    const handleTrades = () => {
        console.log("trades");
        let trades = Object.values(MM.getModels().Trade);
        let tradeMap = {};

        trades.forEach(trade => {
            const { wood, stone, iron } = trade.attributes;
            const destination_town_id = trade.attributes.destination_town_id;

            let town = MM.getModels().Town[destination_town_id];
            console.log(town);
            if (!town) return;

            let projectedWood = town.attributes.resources.wood + wood;
            let projectedStone = town.attributes.resources.stone + stone;
            let projectedIron = town.attributes.resources.iron + iron;

            tradeMap[trade.id] = {
                projectedWood,
                projectedStone,
                projectedIron,
                townName: town.name,
            };

            let timeUntilArrival = (trade.attributes.arrival_at * 1000) - Date.now();
            let tradeElement = document.getElementById(`trade_${trade.id}`);
            if (tradeElement) {
                const resourceDetails = `
                <br>
                <span class="res_icon resource_wood_icon">${projectedWood}</span>
                <span class="res_icon resource_stone_icon">${projectedStone}</span>
                <span class="res_icon resource_iron_icon">${projectedIron}</span>
            `;
                tradeElement.insertAdjacentHTML('beforeend', resourceDetails);

                if (tradeAlerts[trade.id] !== true) {
                    const alertButton = document.createElement('button');
                    alertButton.innerText = 'Set Alert';
                    alertButton.onclick = () => setAlertTimer(timeUntilArrival, trade.id);
                    tradeElement.appendChild(alertButton);
                }
            }
        });
    };

    $(document).ajaxComplete(function (e, xhr, opt) {
        try {
            var url = opt.url.split("?"), action = "";
            if (typeof (url[1]) !== "undefined" && typeof (url[1].split(/&/)[1]) !== "undefined") {
                action = url[0].substr(5) + "/" + url[1].split(/&/)[1].substr(7);
            }
            switch (action) {
                case "/town_overviews/trade_overview":
                    const targetNode = document.getElementById("trade_overview_movements_wrapper");
                    if (targetNode) {
                        console.log("Trade overview page loaded");
                        observer = new MutationObserver((mutations) => {
                            mutations.forEach(mutation => {
                                if (mutation.type === 'attributes' || mutation.type === 'childList') {
                                    if (targetNode.classList.contains('expanded')) {
                                        if (firstTime) {
                                            handleTrades();
                                            firstTime = false;
                                        }
                                    } else {
                                        firstTime = true;
                                    }
                                }
                            });
                        });
                        const config = { attributes: true, childList: true, subtree: true };
                        observer.observe(targetNode, config);
                    } else {
                        firstTime = true;
                    }

                    break;
            }
        } catch (error) {
            console.log(error);
        }
    });

    // Function to set alert timer
    const setAlertTimer = (time, id) => {
        if (!tradeAlerts[id]) {
            tradeAlerts[id] = true;
            console.log("Trade alert set for trade ID:", id);
        } else {
            console.log("Trade alert already set for trade ID:", id);
            return;
        }

        setTimeout(() => {
            audio.play();
            console.log("Trade is done");
        }, time);
    };
})(); 